font-size: 60px;
text-transform: capitalize;
width: 80%;
color: #202020;
font-family: 'Sora';
align-self: flex-start;
display: flex;
justify-content: center;
align-items: center;
margin: 1rem auto;
border-bottom: 2px solid;
width: fit-content;
`;

const Items = styled.ul`
list-style:none;
width: 100%;
height: 100%;
display: flex;
